import React from 'react';
import './navbar.css';
import {HashLink as Link } from 'react-router-hash-link'
const Navbar = () => {
    return ( 
        <>
        <div className="">
        <nav className="navbar navbar-expand-sm">
            <h3 className=" name ml-2">Hannan Rajput</h3> <h1 className="coma">.</h1>
             <ul className="navbar-nav mx-auto">
                    <Link smooth to='#home'  className="nav-link bar" style={{color:"white"}}><li className="nav-item">HOME</li></Link>
                    <Link smooth to='#about' className="nav-link bar" style={{color:"white"}}><li className="nav-item">ABOUT</li></Link>
                    <Link smooth to='#resume' className="nav-link bar" style={{color:"white"}}><li className="nav-item">RESUME</li></Link>
                    <Link smooth to='#service' className="nav-link bar" style={{color:"white"}}><li className="nav-item">SERVICES</li></Link>
                    <Link smooth to='#projects' className="nav-link bar" style={{color:"white"}}><li className="nav-item">PROJECTS</li></Link>
                    <Link smooth to='#contact' className="nav-link bar" style={{color:"white"}}><li className="nav-item">CONTACT</li></Link>
                    
                </ul>
        </nav>
        
            
        
     </div> 
    </>
     );
}
 
export default Navbar;
